import React from 'react';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Header from './features/header/Header';
import Home from './pages/home/Home';


function App() {
  
  return (
    <div className="App">
      <Router>
        <Header />
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>

        </Switch>
    </Router>
      {/* Footer */}
    </div>
  );
}

export default App;
